/* eslint-disable */
import axios from "axios";

var results;

function Search(props) {
  const arr = props.names.split(" ");
  var searchWords = {};
  var searchResults = "";

  // JSON 형식으로 값 저장
  for (var i in arr) {
    var queryWords = arr[i];
    searchWords[queryWords] = "number";
  }

  try {
    var url = "http://127.0.0.1:8000/api/";
    if (props.typeSelect === "dog") {
      url += "dog";
    } else {
      url += "cat";
    }

    axios
      .get(url, {
        params: { breed: props.breed },
      })
      .then((response) => {
        searchResults = response.data;
        results = searchResults[0];
      });
  } catch (error) {
    console.error(error);
  }

  const message = JSON.stringify(results);
  return <h1>{message}</h1>;
}

export default Search;
